import React, { useState, useEffect } from 'react';
import {
  Box,
  Grid,
  Paper,
  Typography,
  Button,
  TextField,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
} from '@mui/material';
import Editor from '@monaco-editor/react';
import { socket } from '../socket';

function CodingChallenge() {
  const [language, setLanguage] = useState('python');
  const [code, setCode] = useState('');
  const [input, setInput] = useState('');
  const [output, setOutput] = useState('');
  const [error, setError] = useState('');
  const [sessionId, setSessionId] = useState(null);
  const [executing, setExecuting] = useState(false);
  const [compiling, setCompiling] = useState(false);
  const [compilationError, setCompilationError] = useState('');

  useEffect(() => {
    console.log('Setting up socket listeners for language:', language);
    
    // Create a new session when language changes
    socket.emit('createSession', { language });
    console.log('Emitted createSession event');

    socket.on('sessionCreated', ({ sessionId, boilerplate }) => {
      console.log('Received sessionCreated event:', { sessionId, boilerplate });
      setSessionId(sessionId);
      // Provide minimal Java boilerplate for user
      if (language === 'java') {
        const javaCode = `public class Main {
    public static void main(String[] args) {
        System.out.println("Hello from Java!");
    }
}`;
        console.log('Setting Java code:', javaCode);
        setCode(javaCode);
      } else {
        console.log('Setting boilerplate code:', boilerplate);
        setCode(boilerplate || '');
      }
    });

    socket.on('executionResult', (result) => {
      console.log('Received execution result:', result);
      setExecuting(false);
      setCompiling(false);
      
      if (!result) {
        setError('No result received from server');
        return;
      }

      if (result.status === 'Compilation Error') {
        console.log('Setting compilation error:', result.error);
        setCompilationError(result.error || 'Compilation failed');
        setError('');
        setOutput('');
      } else if (result.status === 'error' || result.error) {
        console.log('Setting runtime error:', result.error);
        setError(result.error || 'Execution failed');
        setCompilationError('');
        setOutput('');
      } else {
        console.log('Setting output:', result.output);
        setOutput(result.output || '');
        setError(result.error || '');
        setCompilationError('');
      }
    });

    return () => {
      console.log('Cleaning up socket listeners');
      socket.off('sessionCreated');
      socket.off('executionResult');
    };
  }, [language]);

  const handleLanguageChange = (event) => {
    setLanguage(event.target.value);
  };

  const handleExecuteCode = () => {
    if (!code || !code.trim()) {
      setError('Please enter some code to execute');
      return;
    }

    console.log('Executing code:', { code, input, language });
    setExecuting(true);
    setCompiling(true);
    setOutput('');
    setError('');
    setCompilationError('');
    
    socket.emit('executeCode', {
      sessionId,
      code: code.trim(),
      input: input ? input.trim() : '',
      language
    });
    console.log('Emitted executeCode event');
  };

  return (
    <Box sx={{ p: 3 }}>
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <FormControl fullWidth>
            <InputLabel>Language</InputLabel>
            <Select value={language} onChange={handleLanguageChange}>
              <MenuItem value="python">Python</MenuItem>
              <MenuItem value="java">Java</MenuItem>
            </Select>
          </FormControl>
        </Grid>
        <Grid item xs={12}>
          <Paper sx={{ p: 2 }}>
            <Editor
              height="400px"
              language={language}
              value={code}
              onChange={(value) => setCode(value)}
              theme="vs-dark"
            />
          </Paper>
        </Grid>
        <Grid item xs={12}>
          <TextField
            fullWidth
            multiline
            rows={4}
            label="Input"
            value={input}
            onChange={(e) => setInput(e.target.value)}
          />
        </Grid>
        <Grid item xs={12}>
          <Button
            variant="contained"
            onClick={handleExecuteCode}
            disabled={executing}
          >
            {executing ? 'Running...' : 'Run Code'}
          </Button>
        </Grid>
        {compilationError && (
          <Grid item xs={12}>
            <Paper sx={{ p: 2, bgcolor: '#ffebee' }}>
              <Typography color="error">Compilation Error:</Typography>
              <Typography component="pre" sx={{ whiteSpace: 'pre-wrap' }}>
                {compilationError}
              </Typography>
            </Paper>
          </Grid>
        )}
        {error && (
          <Grid item xs={12}>
            <Paper sx={{ p: 2, bgcolor: '#ffebee' }}>
              <Typography color="error">Error:</Typography>
              <Typography component="pre" sx={{ whiteSpace: 'pre-wrap' }}>
                {error}
              </Typography>
            </Paper>
          </Grid>
        )}
        {output && (
          <Grid item xs={12}>
            <Paper sx={{ p: 2, bgcolor: '#e8f5e9' }}>
              <Typography>Output:</Typography>
              <Typography component="pre" sx={{ whiteSpace: 'pre-wrap' }}>
                {output}
              </Typography>
            </Paper>
          </Grid>
        )}
      </Grid>
    </Box>
  );
}

export default CodingChallenge;
